    false,nt"url": null,nt"notes": "Trumpeter (Cygnus buccinator) and tundra
    swan (Cygnus columbianus) populations wintering in northwest Washington State and
    on the Sumas Prairie, British Columbia, from 1999-2008, lost over 2,574 members,
    the majority (62%, 1,586) were confirmed as lead poisoned caused by the ingestion
    of lead pellets.  Although mortalities occurred in both trumpeter and tundra swans,
    over 95% of lead poisoned swans were trumpeter swans. In 2001, an international
    effort was initiated to locate the source(s) of the lead.  Participants in the investigation
    include the Washington Department of Fish and Wildlife, U. S. Fish and Wildlife
    Service, Environment Canada u2013 Canadian Wildlife Service, The Trumpeter Swan
    Society and the University of Washington (Washington Cooperative Fish and Wildlife
    Research Unit) with assistance from numerous other government and non-government
    organizations.  The partners took a multi-faceted approach to investigate the swan
    die-off and potential secondary exposures to other wildlife, including bald eagles.",nt"license_title":
